import React, { useState } from 'react';
import './styles.scss';

function Menu() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="test">
      <div className="menu-container">
        <button type="button" onClick={toggleMenu} className="menu-icon">
          <span>☰</span>
        </button>
        {isOpen && (
        <div className="menu-items">
          <a href="/">Hem</a>
          <a href="/pruning">Trädbeskärning</a>
          <a href="/grass">Gräsmattor</a>
          <a href="/stenanlaggning">Stenanläggning</a>
          <a href="/contact">Kontakta</a>
        </div>
        )}
        <a className="title" href="/">Trädgårdsanläggning AB</a>
      </div>
    </div>
  );
}

export default Menu;
